class Solution:
    def majorityElement(self, nums: List[int]) -> int:
        n = len(nums)
        if n == 1:
            return nums[0]
        mid = n//2
        start = 0
        end = n-1
        ind = self.partition(nums, start, end)
        while ind != mid:
            if ind > mid:
                end = ind-1
            else:
                start = ind+1
            ind = self.partition(nums, start, end)
        return nums[ind]

    def partition(self, nums, lo: int, hi: int):
        i = lo+1
        j = hi
        # n = 20
        while True:
        # while i < j:
            while  nums[i] < nums[lo]:
                if i == hi:
                    break
                i += 1

            while nums[j] > nums[lo]:
                if j == lo:
                    break
                j -= 1
            if i >= j:
                break
            nums[i], nums[j] = nums[j], nums[i]
            i += 1
            j -= 1
        nums[lo], nums[j] = nums[j], nums[lo]

        return j 
        

